import "./Expense.css";
import ExpenseItem from "./ExpenseItem";

function Expense(props) {
  const arrayLength = props.length;
  let entry = "";

  for (let i = 0; i < arrayLength - 1; i++) {
    entry += <ExpenseItem data={props[i]}></ExpenseItem>;
  }

  return entry;
}

export default Expense;
